import React from 'react';
import ReactDOM from 'react-dom';

ReactDOM.render(
  <>
    <h1>My Name is Gangadhar</h1>
    <p>My Learning Journey</p>
    <ol>
      <li></li>
    </ol>
  </>,
  document.getElementById('root')
);
